Здравствуйте, друзья! В связи с расширением психологической практики решил заявить о себе во всех соцсетях)

Мне 39 лет, девятнадцать из которых моя жизнь связана с психологией. Причиной, по которой я заинтересовался этой наукой, было юношеское любопытство к познанию себя и стремление помочь другим разобраться в себе.

Познание себя помогло мне справиться с кризисными ситуациями в собственной жизни и достойно пройти их. Это укрепило мою убежденность в правильности выбранного пути. В настоящее время я продолжаю дополнять свое академическое образование в ВГУ современными техниками и методиками (например, EMDR и НЛП).

Стремление помочь другим привело меня к ведению частной практики.

Если Вы дочитали до этих строк, значит часть Вас уже начала искать путь к себе. Предлагаю Вам свои знания, техники и инструменты для того, чтобы этот поиск был успешен.

Основные направления работы:
✅ Депрессия;
✅ Тревога;
✅ Агрессия;
✅ Различные виды аддиктивного поведения;
✅ Фобии;
✅ Проблемы в семейных отношениях;
✅ Преодоление возрастных кризисов;
✅ Преодоление экзистенциальных кризисов (состояние тревоги, чувство глубокого психологического дискомфорта при вопросе о смысле существования);
✅ Проживание утраты близких, горя;
✅ Помощь при расставании, разводе.

В работе использую интегративный подход, сочетая гештальт-терапию и EMDR.

